package string
import (
	"testing"
)
func TestRepeatedSubstringPattern(t *testing.T){
	for caseID, testCase := range []struct{
		s	 string
		want bool
	}{
		{"a", false},
		{"abac", false},
		{"abab", true},
		{"aba", false},
		{"babbabbabbabbab", true},
		{"abcabcabcabc", true},
		{"", false},
	}{
		result := RepeatedSubstringPatternTest(testCase.s)
		if result != testCase.want{
			t.Errorf("case-%d: result = %v want = %v", caseID, result, testCase.want)
			break
		}
	}
}

func TestMaxRepeating(t *testing.T){
	for caseID, testCase := range []struct{
		s	 string
		word string
		want int
	}{
		{"ababc", "ab", 2},
		{"ababc", "ba", 1},
		{"ababc", "ac", 0},
	}{
		result := MaxRepeating(testCase.s, testCase.word)
		if result != testCase.want{
			t.Errorf("case-%d: result=%d want = %d", caseID, result, testCase.want)
			break
		}
	}
}
